INSERT INTO `cms_article_data` VALUES ('1',
                                       '<p>&nbsp; &nbsp; &nbsp; &nbsp; 现在，他前生所做的这个梦，向他缓缓走过来了，裹着银白的纱，云里雾里，向他走过来了。走过玫瑰色的窗子，她变了玫瑰色；走过蓝色的窗子，她变了蓝色；走过金黄色的窗子，她和她的头发燃烧起来了。</p><p><br></p><p><img src=\"/uploads/editor/userid_1/images/2017-09-21/bc4e61ceb784415e8797315cfb9adef8.jpg\" alt=\"57004560_p0\" style=\"max-width:100%;\"><br></p><p><br></p>',
                                       '网络', '1,2,3', '1'),
  ('10', '<p>有一年圣诞节，室友和女朋友约会去了。我一个人在房间里。我把浴室的灯灯开，把热水灯开，浴室里就雾气腾腾透出光亮，像一个神迹显现。我在隔着一个客厅的房间里上网，写日志，发微博，假装自己正在等一个女人洗完澡，出来陪我做爱，但其实水是我开的，浴室里没人。\r\n</p><p><br></p><p>我的室友回来了，带着一个女孩，他很吃惊的看着浴室，\r\n</p><p><br></p><p>“你带了人回来吗？”\r\n</p><p><br></p><p>我本应该诚实，但真相太可悲了，我回复的是：“恩，我带了人回来。”\r\n</p><p><br></p><p>他拍拍我，说好小子，真看不出来呀，那就不打扰你了，便神色隐秘的一笑，和他的女友钻进他的房间了。\r\n</p><p><br></p><p>但其实浴室里没有人，水是我开的，过了一会，我觉得这样很浪费，就把水关了回到自己的房间睡着了。\r\n</p><p><br></p><p>后来我的室友就跟人说，我有一个女友。别人就一问我，你有一个女友吗。我怎么说呢。我只能说是，恩，我有女朋友。\r\n</p><p><br></p><p>因为我不能告诉他们水是我开的，卧室里没有人。\r\n</p><p><br></p><p>所以我度过了一段麻烦的日子。我不能和机油们出去了，因为他们听说，我有个女友。\r\n</p><p><br></p><p>“去陪你的小清人吧”，他们一群人哄着赶走了我。\r\n</p><p><br></p><p>工头福利发电影票，他们给了我两张，我装作很感谢的样子，可是我从哪儿找另一个人陪我去看电影呢。所以我一个人，旁边的位置上放着我的爆米花。\r\n</p><p><br></p><p>“你和你的女朋友吵架吗？”他们问我，我该怎么回答呢。我说，不经常吵，这是真的，恩，我们没吵过架。\r\n</p><p><br></p><p>有些时候他们看见不到我的女朋友，就很奇怪，为什么见不到你的女朋友呢。而且有些心直口快的女孩说，你从不给你的女朋友买东西，还说，不吵架，就是冷战了，分手了。所以我被她们拉着买了一些女人的小玩意，有些东西真的不错，我想，在我送给她的时候，她会很高兴吧。\r\n</p><p><br></p><p>后来他们还是没有见过我的女朋友，一直都没有。我怎么办？告诉他们浴室里没有人，水是我开的？不行，我说不出口。没有办法，我买了一些卫生巾，不常见的型号，还有唇膏，一些粉底。\r\n</p><p><br></p><p>有人走进我的房间，说这些东西是谁的。\r\n</p><p><br></p><p>“那些是我女朋友的，因为她有时候在我这里过夜，所以我为她准备了一些常用品，比如卫生巾，这个是她特别用的那种。”\r\n</p><p><br></p><p>女人听完泪眼婆娑，揪她男友的袖子，你看看人家的男喷油！他身边的男人露出了不好意思的神色。\r\n</p><p><br></p><p>谁会不信我呢？谁会不信我有个女友呢。只是她性格怪异，不爱见人而已。\r\n</p><p><br></p><p>我隔三差下给卫生巾滴上可乐，扔进厕所的垃圾桶里，我上班前在粉底上揩一下，抹在脸上。要是有一部相机留下每天我卧室内的照片，那些东西部在一天天减少，看起来就好像有个隐形女友一样。反正人人都相信我有个女朋友，没人会发觉浴室里其实没有人，水是我开的。\r\n</p><p><br></p><p>又过了很长时间，工头找我去办公室，面带关切，莫名其妙给了我一天假，隔壁桌的两个女孩面带同情的看着我，鼓励我，像我这么好的男人，肯定能找到更好的。我才知道有人看到我一个人去看电影了，还看到我一个人坐了两个人的位子，在电影中间哭。\r\n</p><p><br></p><p>哦，原来我是失恋了，虽然那部片子很感人啊！\r\n</p><p><br></p><p>我简直想痛骂自己一顿，这是早就可以通往解脱的一条路，我早就该这么说啊！卫生巾和粉底太贵了，化妆品我都买了Channel的。我不知不觉这么过了好长时间，都没有钱付房租了！\r\n</p><p><br></p><p>我揪着自己的头发，很痛苦的样子，我看见她们又捂着嘴，用手护住鼻梁两边，向眼睛里扇风，背过头。终于，还是有一个人忍不住还哭了。\r\n</p><p><br></p><p>我没哭，我跟我女友没什么感清。\r\n</p><p><br></p><p>我又单身了，吃过两顿安慰饭之后，一切又回归了生活的平静，有女孩要给我介绍女朋友。\r\n</p><p><br></p><p>“他为她女友买专用的卫生巾呢！”她们不厌其烦的说，讲了很多我部不知道的痴情故事。是吗？那个介绍来的女孩偏过头来看一眼我\r\n</p><p><br></p><p>我怎么办，我只能说，是啊，难道要我告诉她，浴室里没有人，水是我开的。\r\n</p><p><br></p><p>我跟那个女孩出去了两次，后来她委婉的把这事分了\r\n</p><p><br></p><p>“你的心里空落落的，我感觉你还爱着她，我没信心取代这个位置。“她眼红红的。临走，还给我一拥抱。\r\n</p><p><br></p><p>这姑娘真有意思。我没有女朋友，浴室的水是我开的。但我不能告诉他。\r\n</p><p><br></p><p>后来就没人给我介绍女朋友了\r\n</p><p><br></p><p>经她这么一点拨，我开始想念起我的前女友来，然后我想起来，我没有一个前女友啊，浴室里没有人，水是我开的。\r\n</p><p><br></p><p>又到了一年圣诞节，还是那个室友，和一个不同的姑娘出去了，我一个人在屋里上网\r\n</p><p><br></p><p>我那时候想，不知道那一年圣诞节，我究竟是因为什么把浴室里的热水灯开呢？我一个人点着一根烟，在昏暗的灯光里，感觉很静，想了很久，突然想起来，原来我是在想象有一个女孩是属于我的。\r\n</p><p><br></p><p>没有抗拒这诱惑力，我打开灯，扭开热水，浴室里就雾气腾腾透出光亮，像一个神迹显现。这时候，我的室友搂着那个女孩回来了，他看着浴室，先是好奇，接着露出了惊讶和欣喜的神色\r\n</p><p><br></p><p>“是她回来了?”\r\n</p><p><br></p><p>他旁边的女孩看起来高兴极了，对我室友说：“是你跟我说的那个吗，是他以前那个女朋友吗？”\r\n</p><p><br></p><p>两个人开心的不得了，在客厅里高兴的又蹦又跳，好像约瑟和马利亚。\r\n</p><p><br></p><p>“不，没有人。”我说，“浴室里的水是我开的。&nbsp;</p><p><br></p>', '来源', '1,2,3', '1'),
  ('11', '<p>我的日子会怎么过？</p><p>我会一样的洗衣服，擦地，管我的盆景，铺我的床。偶尔，我会去小镇上，在买东西的时候，跟人说说话，去邮局信箱里，盼一封你的来信。</p><p>    也可能，在天气晴朗，而又心境安稳的时候，我会坐飞机，去那个最后之岛，买一把鲜花，在荷西长眠的地方坐一个静静的黄昏。</p><p>    再也没有鬼哭神号的事情了，最坏的已经来过了，再也没有什么。我只是有时会胃痛，会在一个人吃饭的时候，有些食不下咽。</p><p>    也曾对你说过，暮色来时，我会仔细的锁好门窗，也不再在白日将自己打扮得花枝招展，因为我很明白，昨日的风情，只会增加自己今日的不安全，那么，我的长裙，便留在箱子里吧。</p><p>    又说过，要养一只大狼狗，买一把猎枪，要是有谁，不得我的允许敢跨入我的花园一步，那么我要他死在我的枪下。说出这句话来，你震惊了，你心疼了，你方才知道，Ｅｃｈｏ的明日不是好玩的...</p><p><br></p><p><img src=\"/uploads/editor/userid_1/images/2017-09-21/88aeab76d9c9482fab3018224d6d3857.jpg\" alt=\"aab5119f05a7a9f9fdfe0840a940c66b_r\" style=\"max-width:100%;\"><br></p><p><br></p>', '来源', '1,2,3', '1'),
  ('12', '<p>&nbsp;“怎么晒这么黑？” </p><p><br></p><p>“我徒步旅行了两个礼拜！到处走，只带了背包和睡袋。所以才晒黑的。” </p><p><br></p><p>“走到哪儿去了？” </p><p><br></p><p>“从金泽开始，绕了能登半岛一周，然后走到新宿。”</p><p><br></p><p> “一个人？” </p><p><br></p><p>“是呀！”我说。“到处都会碰上旅伴嘛！” </p><p><br></p><p>“有没有什么罗曼史呀？在旅途上和女孩邂逅什么的。”</p><p><br></p><p> “罗曼史？”我惊道。“喂！你果然是误解了。带着睡袋、满脸胡须、随处乱逛的人要到哪儿去搞什么罗曼史呀？” </p><p><br></p><p>“你总是像这样一个人旅行吗？”</p><p><br></p><p> “是啊！”\r\n“你喜欢孤独吗？”她托着腮说道。“喜欢一个人旅行，一个人吃饭，上课的时候一个人坐得远远的？”</p><p><br></p><p> “没有人喜欢孤独。只是不想勉强交朋友。要真那么做的话，恐怕只会失望而已。”</p><p><br></p><p><br></p>', '来源', '1,2,3', '1'),
  ('13', '<p>&nbsp; &nbsp; &nbsp; &nbsp; 我们都会遇到那个人吧，陪你走过一段路，影影绰绰似乎开始了模糊的恋情，事后想来却仿佛停止于尚未开始的爱。 或许是多年再见，各自安静生活数年。在某个人潮拥挤的街头，透过公车的玻璃窗突然看见你，想叫让司机马上停车，想用力拍打窗户来引起你的注意，想从车上跳下来，想奔跑，想大喊大叫，想把整个阻隔在你我之间的世界撕裂。呼吸急促，面额潮红，手指颤抖，在激烈的想象中把自己感动的快哭了。而事实总是一动不动的坐着，安静的看你远去。你的脸，从开始到现在，我原来从未曾看清楚过。我知道我只能陪你走这一段路。</p><p><br></p>', '来源', '1,2,3', '1'),
  ('14', '<p>&nbsp; &nbsp; &nbsp; &nbsp; 重要的人，不能忘记的人，不想忘记的人！悲伤和爱怜，都一样消失。甚至连自己为什么会哭，我都已经不明了。如沙子作的城堡崩塌一样，感情也轰然不在。沙子崩塌以后，也有唯一不会消失的沙块，那就是寂寞。我了解了，这个瞬间我知道了。之后残存于我心中的，只会有这个感情。像是被人强行塞给的负重，我怀抱着寂寞。――没什么。世界如果是如此残酷的地方的话，我会带着这唯一的寂寞，用全身全灵活给这个世界看。带着这唯一的感情永远的挣扎下去。即使相隔天涯，即使再也见不到面，我会挣扎。永远不可能向这个世界妥协――一时间，我只是强烈的怀抱着想要和神明较劲的想法，连自己忘却了这件事，都马上忘却了。所以我在这样感情的奔流下，最后一次，大声向夜空喊道。你的，名字是？<br></p><p><br></p>', '来源', '1,2,3', '1'),
  ('15', '<p>你，<br>一会看我，<br>一会看云。<br>我觉得，<br>你看我时很远，<br>你看云时很近。<br></p><p><br></p>', '来源', '1,2,3', '1'),
  ('16', '<pre><code>少年听雨歌楼上，  \r\n红烛昏罗帐。  \r\n壮年听雨客舟中，  \r\n江阔云低，  \r\n断雁叫西风。 \r\n\r\n而今听雨僧庐下，  \r\n鬓已星星也。 \r\n悲欢离合总无情，  \r\n一任阶前点滴到天明。</code></pre><p><br></p>', '来源', '1,2,3', '1'),
  ('17', '<p>“姑娘，庭前飘雨风逍遥，为何在此掩面而泣？”&nbsp;</p><p>“君不知，故人一去仍未归，我凄苦无依，门前树都已亭亭如盖，让我怎能欢心？”&nbsp;</p><p>“那你为何不抬头看看我？”<br></p><p><br></p><p><img src=\"/uploads/editor/userid_1/images/2017-09-21/7d417836c5b54cf68283971f24fa6f7e.jpg\" alt=\"57004560_p2\" style=\"max-width:100%;\"><br></p><p><br></p>', '来源', '1,2,3', '1'),
  ('18', '<p>因为这个世界上没有什么东西可以比得上孩子暗地里悄悄所怀的爱情！因为这种爱情不抱希望，低声下气，曲意逢迎，热情奔放……</p><p>这和成年人那种欲火炙烈，不知不觉中贪求无厌的爱情完全不同。只有孤独的孩子才能把全部的热情集聚起来。我毫无阅历，毫无准备……</p><p>我一头栽进我的命运，就像跌进一个深渊……</p><p>从那一秒钟起，我的心里就只有一个人——就是你……<br></p><p><br></p>', '来源', '1,2,3', '1'),
